import { createRouter, createWebHashHistory } from 'vue-router'
import HomeView from '../views/HomeView/HomeView.vue'
import AboutView from '../views/AboutView/AboutView.vue'
import BitrixView from '../views/BitrixView/BitrixView.vue'
import HtmlView from '../views/HtmlView/HtmlView.vue'
import JSView from '../views/JSView/JSView.vue'

const routes = [
  {
    path: '/',
    name: 'home',
    component: HomeView
  },
  {
    path: '/bitrix',
    name: 'bitrix',
    component: BitrixView
  },
  {
    path: '/html',
    name: 'html',
    component: HtmlView
  },
  {
    path: '/javascript',
    name: 'javascript',
    component: JSView
  },
  // {id: 4, title: "TS", txtKey: "javascript"},
  // {id: 5, title: "CSS", txtKey: "css"},
  // {id: 6, title: "JS-фреймворки", txtKey: "js-frameworks"},
  {
    path: '/about',
    name: 'about',
    component: AboutView
    // route level code-splitting
    // this generates a separate chunk (about.[hash].js) for this route
    // which is lazy-loaded when the route is visited.
    // component: () => import(/* webpackChunkName: "about" */ '../views/AboutView.vue')
  }
]

const router = createRouter({
  history: createWebHashHistory("/itdata/"),
  routes
})

export default router
